import React from "react";
import { TwitterTimelineEmbed } from "react-twitter-embed";
import InstagramEmbed from "react-instagram-embed";
import twitter from "../images/twitter.jpg";
const News = () => {
  return (
    <section className="news py-5">
      <div className="container">
        <h2 className="heading-secondary u-margin-bottom ">أخبارنا</h2>
        <div className="row">
          <div className="col-md-6">
            <div className="news__twitter-img">
              
            </div>
          </div>
          <div className="col-md-6">
            <TwitterTimelineEmbed
              sourceType="profile"
              screenName="saradiqsa"
              options={{
                height: "400",
              }}
              theme="light"
              noHeader="true"
              noBorders="true"
              noFooter="true"
            ></TwitterTimelineEmbed>
          </div>
        </div>
      </div>
    </section>
  );
};

export default News;

